import { useEffect, useState } from "react";
import { api } from "../service/Api";

function ProducibleProductsPage() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    api.get("/production/calculate?page=0&size=20")
      .then(res => {
        setProducts(res.data.content || []);
      })
      .catch(err => console.error("Error fetching producible products:", err))
      .finally(() => setLoading(false));
  }, []);

  if (loading) return <p>Loading...</p>;

  return (
    <div>
      <h1>Producible Products</h1>
      {products.length === 0 ? (
        <p>No producible products</p>
      ) : (
        <table border="1">
          <thead>
            <tr>
              <th>Code</th>
              <th>Name</th>
              <th>Quantity Producible</th>
              <th>Unit Price</th>
              <th>Total Price</th>
            </tr>
          </thead>
          <tbody>
            {products.map(p => (
              <tr key={p.productCode}>
                <td>{p.productCode}</td>
                <td>{p.productName}</td>
                <td>{p.quantity}</td>
                <td>{p.unitPrice.toFixed(2)}</td>
                <td>{(p.unitPrice * p.quantity).toFixed(2)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default ProducibleProductsPage;
